import Link from "next/link";
import styles from './Authorization.module.scss';


const Authorization = () => {
    return (
        <div className="auth-component">
            <form className="auth-form">
                <h1>Sign In</h1>
                <input type="text" className="common-input" placeholder="Login" />
                <input type="text" className="common-input" placeholder="Password" />
                <button className="purple-btn">Log In</button>
                <Link href="/registration">
                    <a className={styles['create-account-link']}>or create new account</a>
                </Link>
            </form>
        </div>
    )
}

export default Authorization;
